import React from 'react';
import { Link } from 'react-router-dom';

export default function Header() {
	return (
		<div className='ui secondary pointing menu'>
			<div className='right menu'>
				<Link to='/' className='item'>
					Stream
				</Link>
			</div>
		</div>
	);
}
